//SPDX-License-Identifier: MIT
pragma solidity ^0.6.9;

import "./Cube.sol";
import "../contracts/interfaces/BEP20/IBEP20.sol";
import "../contracts/interfaces/Pancakeswap/interfaces/IPancakeRouter02.sol";
import "../contracts/interfaces//BEP20/IBEP20.sol";
import "../contracts/interfaces/Bdollar.fi/ShareRewardPool.sol";

contract NPOOL {
    address internal constant PANCAKE_ROUTER_ADDRESS =
        0x05fF2B0DB69458A0750badebc4f9e13aDd608C7F;

    address internal constant WBNB = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    address internal constant ShareRewardPool_Address =
        0x948dB1713D4392EC04C86189070557C5A8566766;
    address private LP_Cake = 0xc5b0d73A7c0E4eaF66baBf7eE16A2096447f7aD6;
    address BDO = 0x190b589cf9Fb8DDEabBFeae36a813FFb2A702454;
    address BUSD = 0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56;

    address _admin;

    event event1(uint halfDeposit);
    event event2(uint halfDeposit);
    event event3();
    event event4();

    IPancakeRouter02 private pancakerouter;
    IBEP20 private WBNBtoken;
    ShareRewardPool private shareRewardPoolInstance;
    IBEP20 private LP_Caketoken;
    IBEP20 private BDOtoken;
    IBEP20 private BUSDtoken;

    constructor() public payable {
        pancakerouter = IPancakeRouter02(PANCAKE_ROUTER_ADDRESS);
        shareRewardPoolInstance = ShareRewardPool(ShareRewardPool_Address);
        LP_Caketoken = IBEP20(LP_Cake);
        WBNBtoken = IBEP20(WBNB);
        BDOtoken = IBEP20(BDO);
        BUSDtoken = IBEP20(BUSD);
        _admin = msg.sender;
    }

    function getPathForTOKENAtoTOKENB(address TokenA, address TokenB)
        private
        view
        returns (address[] memory)
    {
        address[] memory path = new address[](2);
        path[0] = TokenA;
        path[1] = TokenB;

        return path;
    }

    function getEstimatedTOKENBforTOKENA(
        uint256 amountA,
        address TokenA,
        address TokenB
    ) public view returns (uint256[] memory) {
        return
            pancakerouter.getAmountsOut(
                amountA,
                getPathForTOKENAtoTOKENB(TokenA, TokenB)
            );
    }

    function convertTOKENAtoTOKENBKEEP(
        uint256 amountA,
        address TokenA,
        address TokenB
    ) public payable {
        IBEP20 TokanAt = IBEP20(TokenA);

        require(
            TokanAt.approve(address(pancakerouter), amountA),
            "approve failed."
        );
        uint256 deadline = block.timestamp + 30; // using 'now' for convenience, for mainnet pass deadline from frontend!
        pancakerouter.swapTokensForExactTokens(
            getEstimatedTOKENBforTOKENA(amountA, TokenA, TokenB)[1],
            amountA,
            getPathForTOKENAtoTOKENB(TokenA, TokenB),
            address(this),
            deadline
        );
    }

    function depositToBDOPool() public {
        uint256 lptokenBalance = LP_Caketoken.balanceOf(address(this));

        LP_Caketoken.approve(ShareRewardPool_Address, lptokenBalance);
        shareRewardPoolInstance.deposit(0, lptokenBalance);
    }

    function addPancakeliquidityPROXY(
        address tokenA,
        address tokenB,
        uint256 amountA,
        uint256 amountB
    ) public {
        IBEP20 tokenAt = IBEP20(tokenA);
        IBEP20 tokenBt = IBEP20(tokenB);
        require(
            tokenAt.balanceOf(address(this)) >= amountA,
            "Not enough token A to send"
        );
        require(
            tokenBt.balanceOf(address(this)) >= amountB,
            "Not enough token B to send"
        );
        require(
            tokenAt.approve(address(pancakerouter), amountA),
            "approve A failed."
        );
        require(
            tokenBt.approve(address(pancakerouter), amountB),
            "approve B failed."
        );
        uint256 deadline = block.timestamp + 15; // using 'now' for convenience, for mainnet pass deadline from frontend!

        pancakerouter.addLiquidity(
            tokenA,
            tokenB,
            amountA,
            amountB,
            0,
            0,
            address(this),
            deadline
        );
    }

    function ExecutePOOL() public payable {
        uint256 totalDeposit = WBNBtoken.balanceOf(address(this));
        uint256 halfDeposit = totalDeposit / 2;
        convertTOKENAtoTOKENBKEEP(halfDeposit, WBNB, BDO);
        event1(halfDeposit);
        convertTOKENAtoTOKENBKEEP(halfDeposit, WBNB, BUSD);
        event2(halfDeposit);
       
        addPancakeliquidityPROXY(
            BDO,
            BUSD,
            BDOtoken.balanceOf(address(this)),
            BUSDtoken.balanceOf(address(this))
        );
        event3();

        depositToBDOPool();
        event4();
    }

    function getLiquidity() public view returns (uint256) {
        return WBNBtoken.balanceOf(address(this));
    }

    function depositLiquidity(uint256 WBNBtokens) public payable {
        require(WBNBtoken.transferFrom(msg.sender, address(this), WBNBtokens));
    }

    function withdrawLiquidity() public {
        uint256 wbnbValue = WBNBtoken.balanceOf(address(this));
        WBNBtoken.transfer(msg.sender, wbnbValue);
    }
}
